import React, { Component } from "react";
import Button from "@material-ui/core/Button";
import Artists from "./TextFields/Artists";
import Movements from "./TextFields/Movements";
import Centuries from "./TextFields/Centuries";
import Branches from "./TextFields/Branches";
import {
  artistUpdate,
  emailUpdate,
  messageUpdate,
  fetchStart
} from "../Actions/Actions";

class Main extends Component {
  render() {
    return (
      <form>
        <Artists />
        <br />
        <Movements />
        <br />
        <Centuries />
        <br />
        <Branches />
        <Button
          variant="contained"
          color="secondary"
          style={{ position: "relative", bottom: 50 }}
        >
          Submit
        </Button>
      </form>
    );
  }
}

export default Main;
